import React, { Component } from 'react';

import PokemonCard from './pokemonCard';

export default class PokemonList extends Component {
  state = {
    url: "https://pokeapi.co/api/v2/pokemon/"
  }
  render() {
    return (
      <div className="row">
        <PokemonCard />
      </div>
    )
  }
}
